import * as React from "react";
import { makeStyles } from "@mui/core";

export const useStyles = makeStyles(theme => ({
  titleText: {
    '&:hover': {
      cursor: 'pointer',
      transition: 'all .5s ease-in-out'
   }
  }

}));
